import * as React from "react";
import { useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
// var celestiump2p = require('celestiump2p');
import * as celestiumClient from "celestiump2p";
import { io } from "socket.io-client";

function App() {
  useEffect(() => {
    const wasm = import("rusty-web");
    wasm.then((x) => {
      console.log(x);
      console.log(x.create_wallet);
      let pk_bin = localStorage.getItem("pk_bin");
      let sk_bin = localStorage.getItem("sk_bin");
      if (!pk_bin || !sk_bin) {
        alert("No PK/SK in localstorage");
      }

      let celestium_bin = localStorage.getItem("pk_bin");
      if (!celestium_bin) {
        localStorage.setItem("celestium_bin", []);
      }

      js.create_wallet("Jens", celestium_bin, pk_bin, sk_bin);
    });
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
